Conflict-Free Replicated Data Types (CRDTs) are a set of data structure designs that allow for replicated data to be updated concurrently across multiple nodes, without coordination between the nodes, and still converge to the same state once all updates have propagated.

Some key properties of CRDTs:

- Converge to the same state - All nodes that have received the same updates will be in the same state eventually, even without coordination.
- Strong eventual consistency - All reads will eventually return the last updated value, across all nodes.
- Associative and commutative operations - Applying updates in different orders results in the same state.

Here is a simple example of a G-Counter CRDT in Go:

```go
type GCounter struct {
    counters map[string]int
}

func (g *GCounter) Increment(key string) {
    g.counters[key]++
}

func (g *GCounter) Value(key string) int {
    if val, ok := g.counters[key]; ok {
        return val 
    }
    return 0
}

func (g *GCounter) Merge(other GCounter) {
    for key, val := range other.counters {
        g.counters[key] += val
    }
}
```

The GCounter keeps a map of key-value pairs. The Increment and Value methods modify and read those counters. The Merge method allows two GCounters from different nodes to be reconciled by adding all the counters. This ensures increments are not lost or overwritten due to concurrency.

