Here is a generic Java method that waits for a condition to become true with a maximum number of attempts:

```java
public static <T> void waitCondition(Supplier<Boolean> condition, int maxAttempts, long delayMillis) {
  for(int attempt = 0; attempt < maxAttempts; attempt++) {
    if(condition.get()) {
      return; 
    }
    try {
      Thread.sleep(delayMillis);
    } catch (InterruptedException e) {
      throw new RuntimeException(e);
    }
  }

  throw new RuntimeException("Condition not met after " + maxAttempts + " attempts");
}
```

Usage:

```java 
waitCondition(() -> someObject.isReady(), 10, 100); 
```

Breakdown:

- The method is generic so it can be used with any type T
- It accepts a Supplier<Boolean> that defines the condition to check
- It accepts the max number of attempts
- It accepts a delay in milliseconds between attempts
- It loops until the condition is true or max attempts is reached
- On each iteration it checks the condition and sleeps if false
- If max attempts is reached it throws an exception
- Can wait for any condition defined as a Boolean supplier

This provides a simple way to wait asynchronously for a condition with retries instead of blocking the thread indefinitely.

