Here is an Express app that returns a directory listing based on a query parameter:

```js
const express = require('express')
const fs = require('fs')
const path = require('path')

const app = express()

app.get('\/list', (req, res) => {
  const dir = req.query.d
  if (!dir) {
    res.status(400).json({ status: false, error: 'Missing d query parameter' })
    return
  }

  const dirPath = path.join(__dirname, dir)
  fs.readdir(dirPath, (err, entries) => {
    if (err) {
      res.status(500).json({ status: false, error: err.message })
    } else {
      res.json({ status: true, entries })
    }
  })
})

app.listen(3000)
```

This app:

- Defines an `\/list` route that accepts a `d` query parameter
- Gets the directory path from that query parameter 
- Uses `fs.readdir()` to read the entries in that directory
- Returns either an error (status false) or the directory entries (status true)
- Listens on port 3000

So a request like `\/list?d=.\/public` would return the entries in the `public` directory.

